function Profile (){
    const [profiles, setProfiles] = useState([])

    useEffect(() => {
        fetch(`http://localhost:3000/profiles`)
        .then(response => response.json())
        .then(returnedData => {
            setProfiles(returnedData)
        })
    })

    const dinerProfile = profiles.map((profile) => {
        const {id, firstname, lastname, dishes_rated, ratings} = profile;
        const {restaurant, reviews} = ratings;
        // const {dish_name, cuisine, dish_size, rating} = reviews
            return (
                <span key={id}>
                    <p>{firstname} {lastname}</p>
                    <p>Dishes Rated: {Number(dishes_rated)}</p>
                    <ul>{restaurant}
                        {/* <li>{dish_name}</li>
